var title_f17_44_18115="2 D echo dilated cardiomyopathy";
var content_f17_44_18115=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F50731&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F50731&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 551px\">",
"   <div class=\"ttl\">",
"    Dilated cardiomyopathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 531px; height: 244px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are the precordial long axis (panel A) and apical four chamber views (panel B) from a patient with dilated cardiomyopathy. The long axis view demonstrates increased sphericity of the left ventricle (LV) and the long axis and short axis ratio approaches unity (normal 2:1). There is left atrial (LA) enlargment and a very large \"residual\" left ventricular end-systolic volume, ie, at end systole there is a large unejected volume remaining in a dilated LV. The impression of increased sphericity is reinforced in the four chamber view. In addition there is also dilation of the right atrium (RA) and right ventricle (RV) four chamber dilation, connoting a poor prognosis.",
"    <div class=\"footnotes\">",
"     MV: mitral valve; AV: aortic valve; Ao: aorta; TV: tricuspid valve; IVS: interventricular septum; IAS: interatrial septum.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
